import React from 'react';
import './Header.scss'

const Header = () => {
    return (
        <header className='header'>
           <div>
               <span className='logo'>House Stuff</span>
               <ul>
                   <li>About</li>
                   <li>Contacts</li>
               </ul>
           </div>
            <div className='presentation'></div>
        </header>
    );
};

export default Header;
